import Link from 'next/link';
import Button from 'react-bootstrap/Button';
const services_array = ["Prabhakar Mishra", "Solutions", "Projects", "Gear", "Music", "Contact Me"];

const linkStyle = {
  marginRight: 15
}
const Header = () => {
  return (
    <nav>
    {services_array.map(service => (
      <Link href={`/${(service.replace(" Me", '')).replace("Prabhakar Mishra", '')}`}>
        <Button variant="dark-outline" style={linkStyle}>{service}</Button>
      </Link>
  ))}
  </nav>
);
}

export default Header



